            headers:{
                'Content-Type':'multipart/form-data'
            }
          }
        console.log("im in get stripe data  actions");
      dispatch({type:STRIPE_REQUEST})
      const {data} = await axios.get("http://localhost:3001/user/payment/stripeApi",config);
    console.log("stripeData",data)
    dispatch({
        type:STRIPE_SUCCESS,
        payload:data.stripeApiKey
    })
    }catch(error){
